package org.test.framework.primitive;

public class Test_Byte extends Primitive {

	public static boolean byte_Equals(byte x, byte y) {
		// TODO Auto-generated method stub
		return y == x;
	}

	public static boolean byte_Greater(byte x, byte y) {
		// TODO Auto-generated method stub
		return x > y;
	}
	
	public static boolean byte_Less(byte x, byte y) {
		// TODO Auto-generated method stub
		return x < y;
	}

	public static boolean byte_Divisor(byte x, byte y) {
		// TODO Auto-generated method stub
		return y%x == 0;
	}
}
